  InstructionTranslation.create!([
    {id: 1, instruction_id: 7, language: "sw", text: "Tunatafuta mambo ambayo WEWE hushughulika nayo yanayosaidia jamii/nyumba/taasisi kwa fedha, hata kama WEWE hupokei pesa moja kwa moja (kutengeza vitu vya kuuzwa, vitu vya kusukwa, kuuza vitu, kazi ya ngono, kuomba, kuiba)."},
    {id: 2, instruction_id: 7, language: "am", text: "  / / / /   /  (          )   "},
    {id: 3, instruction_id: 7, language: "km", text: "\n  / /   (     )"},
    {id: 4, instruction_id: 14, language: "sw", text: "Maswali yafwatayo yanahusu afya yako."},
    {id: 5, instruction_id: 14, language: "am", text: "   /  "},
    {id: 6, instruction_id: 14, language: "km", text: ""},
    {id: 7, instruction_id: 14, language: "te", text: "     "},
    {id: 8, instruction_id: 16, language: "sw", text: "Maswali 5 yafwatayo yanauliza kuhusu jeraha kuu zaidi ulilopata katika miezi 12 iliyopita. Jeraha ni kuu ikiwa linakufanya ushindwe kushiriki katika shughuli za kawaida kwa angalau siku moja nzima (kama vile shule, michezo, au kazi) au linahitaji mauguzi ya daktari au muuguzi."},
    {id: 9, instruction_id: 16, language: "am", text: "  5   12  /             (      )     /           "},
    {id: 10, instruction_id: 16, language: "km", text: "     (  ) "},
    {id: 11, instruction_id: 16, language: "te", text: " 12 ,         5  .    (, ,   )             ,   ."},
    {id: 12, instruction_id: 18, language: "sw", text: "Tafadhali fikiria huduma zote za afya ambazo WEWE umepokea katika miezi 12 iliyopita."},
    {id: 13, instruction_id: 18, language: "am", text: "/  12  /     /"},
    {id: 14, instruction_id: 18, language: "km", text: "|||| "},
    {id: 15, instruction_id: 20, language: "sw", text: "Kwa sasa tungependa kuuliza maswali machache kuhusu maisha yako ya ngono. Tunajua haya maswali ni ya kibinafsi lakini kumbuka kwamba jina lako halitaonekana mahali popote kwenye fomu hii. Kumbuka pia ni ukweli mtupu ndio utatusaidia kujenga mipangilio ya kupunguza hatari za HIV. Kwa hivyo uwe muaminifu kikamilifu"},
    {id: 16, instruction_id: 20, language: "am", text: "    /          /       /  ..              /    /"},
    {id: 17, instruction_id: 20, language: "km", text: "           \n "},
    {id: 30, instruction_id: 42, language: "te", text: "              .       , , ,      ."},
    {id: 31, instruction_id: 44, language: "sw", text: "Ni kwa kiwango kipi unakubaliana au haukubaliani na matamshi yafuatayo?"},
    {id: 18, instruction_id: 20, language: "te", text: "        .      ,          . ,     HIV      .     ."},
    {id: 19, instruction_id: 34, language: "sw", text: "Maswali yafuatayo yanahusu historia yako ya magonjwa ya zinaa, utumiaji wa njia za kupanga uzazi na hali yako ya HIV na kuchunguzwa. Kwa Magonjwa ya zinaa, ninamaanisha yale yanayopitishwa kwako na mwenzako kupitia ngono. Tunajua haya ni maswali ya faragha, lakini kumbuka kuwa jina lako halionekani mahali popote kwenye fomu hii."},
    {id: 20, instruction_id: 34, language: "am", text: "   /   /  ..  /          /     / /            /       /"},
    {id: 21, instruction_id: 34, language: "km", text: "  STI      Sexually Transmitted Infections (STI)             "},
    {id: 22, instruction_id: 34, language: "te", text: "    STI ,      HIV     .    (STI),               .      ,        ."},
    {id: 23, instruction_id: 41, language: "sw", text: "Sasa tunazo baadhi ya makala kuhusu VIRUSI na UKIMWI ambayo tungependa uyajibu. Kwa kila makala, tafadhali niambie ikiwa Unakana Kabisa, Unakana, Unakubali, au Unakubali Kabisa."},
    {id: 24, instruction_id: 41, language: "am", text: "  ..   /      /        /"},
    {id: 25, instruction_id: 41, language: "km", text: "            "},
    {id: 26, instruction_id: 41, language: "te", text: "    ,              .   ,   , , ,     ."},
    {id: 27, instruction_id: 42, language: "sw", text: "Sasa tunazo baadhi ya makala kuhusu ngono na mipira ambayo tungependa uyajibu. Kwa kila makala, tafadhali niambie ikiwa Ninakataa kabisa, Sikubaliani nawe, Ninakubaliana nawe, au Ninakubaliana nawe kabisa."},
    {id: 28, instruction_id: 42, language: "am", text: "     /      /         /"},
    {id: 29, instruction_id: 42, language: "km", text: "            "},
    {id: 32, instruction_id: 44, language: "am", text: "     ?"},
    {id: 33, instruction_id: 44, language: "km", text: "    ?"},
    {id: 34, instruction_id: 44, language: "te", text: "        ?"},
    {id: 35, instruction_id: 46, language: "sw", text: "Utangulizi. Seti ijayo ya maswali inalenga mambo yanayohusu afya yako kama mwanamke. Tafadhali chukua muda kujibu maswali haya, na jisikie huru kuuliza mhojaji kuhusu maswali usiyoyaelewa."},
    {id: 36, instruction_id: 46, language: "am", text: "                          "},
    {id: 37, instruction_id: 46, language: "km", text: "         "},
    {id: 38, instruction_id: 46, language: "te", text: ".      .       ,          ."},
    {id: 39, instruction_id: 56, language: "sw", text: "Uliza kwa kina ikiwa majibu yote ni hapana: \n\"Hata wakati ulikuwa shuleni?\""},
    {id: 40, instruction_id: 56, language: "km", text: " \n/ /?"},
    {id: 41, instruction_id: 57, language: "sw", text: "Katika miezi 3 iliyopita, ni mara ngapi umetumia  madawa za kulevya ambazo umetaja?"},
    {id: 42, instruction_id: 57, language: "km", text: "  ?"},
    {id: 43, instruction_id: 58, language: "sw", text: "Maswali yafuatayo ni kuhusu mambo ambayo unaweza kuwa umefanya kwa miezi 12 iliyopita."},
    {id: 44, instruction_id: 58, language: "am", text: "   12   /  "},
    {id: 45, instruction_id: 58, language: "km", text: "  "},
    {id: 46, instruction_id: 58, language: "te", text: "    12        ."},
    {id: 47, instruction_id: 59, language: "sw", text: "Waweza kuwa bila raha unapojibu baadhi ya maswali haya. Tafadhali kumbuka kuwa unaweza kukataa kujibu swali lolote au kuacha kidadisi wakati wowote. Unaweza pia kuruka swali lolote ambalo huna raha kulijibu. Majibu yako ni ya siri na yatatumiwa tu kutusaidia kuelewa jinsi watu wanavyofikiria na kutenda."},
    {id: 48, instruction_id: 59, language: "am", text: " /     /          /   /   / /              "},
    {id: 49, instruction_id: 59, language: "km", text: "||||  || ||  ||        ||"},
    {id: 50, instruction_id: 59, language: "te", text: "       .           .        .                 "},
    {id: 51, instruction_id: 61, language: "sw", text: "Maswali yafuatayo yanahusu huduma ya jamii wanaofanya kazi kupitia mashirika kama vilabu vya huduma, kanisa, vikundi vya vitndo kwa vijana. Jumlisha tu kazi ya kujitolea ambayo haikulipiwa."},
    {id: 52, instruction_id: 61, language: "am", text: "                           "},
    {id: 66, instruction_id: 70, language: "am", text: "             /           /?"},
    {id: 53, instruction_id: 61, language: "km", text: "||||||\r\n||  ||"},
    {id: 54, instruction_id: 61, language: "te", text: " , ,    ,             .      ."},
    {id: 55, instruction_id: 62, language: "sw", text: "Orodha zifuatazo ni baadhi ya ugumu au msukosuko wa vitu ambavyo wakati mwingine hufanyika kwa watu. Kwa kila tukio tafadhali onyesha:\na) Ilikufanyikia wewe binafsi\nb) ulishuhudia ikifanyikia mtu mwingine\nc) uliitambua  ikifanyikia  mtu wa familia wa karibu ama rafiki wa karibu;\nd) ulikuwa na ufahamu kuihusu kama sehemu ya kazi yako (kwa mfano, paramedic, polisi, jeshi, ama mhojiwa wa kwanza);\ne) Huna uhakika kama inaingiana; au\nf) Haitumiki kwako.\n\nKuwa na uhakika kuzingatia maisha yako yote (kukua pamoja na kuwa mtu mzima) unapopitia orodha ya matukio."},
    {id: 56, instruction_id: 62, language: "km", text: "   :\n\n(a) \n(b) \n(c) \n(d)  (     ) \n(e) ;  \n(f)  \n\n () "},
    {id: 57, instruction_id: 67, language: "sw", text: "Kwa kila moja ya usemi ufuatao, tafadhali niambie kama Sio Kweli, Ni Kweli Kiasi, au Ni Kweli Kabisa kukuhusu.  Ingetusaidia kama ungejibu kila kitu vizuri hata kama huna uhakika. Tafadhali toa jibu lako kwa msingi ya vile mambo yamekuwa kwako kwa miezi sita iliyopita. Kumbuka, majibu yako yote ni ya siri."},
    {id: 58, instruction_id: 67, language: "am", text: "   / /-           /   /      /     6      /      /"},
    {id: 59, instruction_id: 67, language: "km", text: "                "},
    {id: 60, instruction_id: 67, language: "te", text: "   ,   ,  ,       .            .             .    , ."},
    {id: 61, instruction_id: 68, language: "sw", text: "Tafadhali tuambie ni mara ngapi matamko yafuatayo ni kweli. Ni kweli \"Hapana\", \"Wakati mwingine,\" au \"Kila wakati\""},
    {id: 62, instruction_id: 68, language: "am", text: "                   ?"},
    {id: 63, instruction_id: 68, language: "km", text: "   \"\"\"\"\"\"?"},
    {id: 64, instruction_id: 68, language: "te", text: "       .\r\n , \"  \", \" \", \" \"?"},
    {id: 65, instruction_id: 70, language: "sw", text: "Wakati mwengine watu hutazamia wenzao ili wapate ushirika, msaada, au aina nyengine za usaidizi. Ni mara ngapi wewe huwa wapata kila aina ya usaidizi ufwatao kila mara unapohitaji?"},
    {id: 67, instruction_id: 70, language: "km", text: "     ?"},
    {id: 68, instruction_id: 70, language: "te", text: "    ,,      .  ,      ?"},
    {id: 69, instruction_id: 72, language: "sw", text: "Katika maisha yako ya kila siku ni mara ngapi vitu vifwatavyo vimekufanyikia?"},
    {id: 70, instruction_id: 72, language: "km", text: "    ?"},
    {id: 71, instruction_id: 76, language: "sw", text: "Maswali 2 yafuatayo yanauliza kuhusu hisia zako."},
    {id: 72, instruction_id: 76, language: "am", text: " 2  / /  "},
    {id: 73, instruction_id: 76, language: "km", text: "   "},
    {id: 74, instruction_id: 76, language: "te", text: " 2     ."},
    {id: 75, instruction_id: 77, language: "sw", text: "IMPORTANT:\r\n\r\nIf the child answers yes to either of the two questions above, he/she should be referred to support services and monitored closely after the interview is over. Follow your sites protocol for dealing with situations where the child is upset or reports feeling suicidal."},
    {id: 76, instruction_id: 90, language: "sw", text: "Fikiria kwamba hii ngazi inawakilisha jinsi jamii imeundwa. Hapo juu ya ngazi ni watu ambao wanajiweza - wana pesa nyingi, kiwango cha juu masomo, na kazi ambazo zinaleta heshima kuu. Hapo chini ni watu ambao hawajiwezi kabisa - wana pesa kidogo,masomo kidogo au hawana masomo, hawana kazi au kazi ambazo hakuna mtu anazitaka au kuziheshimu."},
    {id: 77, instruction_id: 90, language: "am", text: "                                            \n             "},
    {id: 78, instruction_id: 90, language: "km", text: "           "}
  ])
